INSERT INTO `brands` (`brand_id`, `brand_name`, `brand_canonial_name`, `brand_image`, `brand_desc`, `brand_added_user`, `brand_status`, `brand_added_date`, `brand_updated_date`) VALUES
(1, 'Schneider', 'schneider', 'se_brand.png', 'Leading the way in energy management and automation, Schneider Electric delivers innovative solutions for efficiency and sustainability.', 2, 1, '2021-07-15 16:51:15', '2023-11-24 09:45:02'),
(2, 'ABB', 'abb', 'abb_brand.png', 'A pioneering technology leader, ABB offers a wide range of products and services, from electrification to industrial automation and robotics.', 2, 1, '2021-07-16 16:45:11', '2023-11-24 09:44:00'),
(3, 'EATON', 'eaton', 'eaton_brand.png', 'A global power management company, Eaton provides electrical solutions that enhance reliability and safety across various industries.', 2, 1, '2021-07-18 05:22:33', '2023-11-24 09:43:30'),
(4, 'GM', 'gm', 'gm_brand.png', 'GM Electricals is a trusted name in the electrical industry, offering a diverse range of products known for their reliability and performance.', 2, 1, '2023-10-22 10:53:47', '2023-11-24 09:42:59'),
(5, 'Siemens', 'siemens', '001.jpg', 'Siemens is at the forefront of technology, providing cutting-edge solutions in electrification, automation, and digitalization for a sustainable future.', 2, 1, '2023-11-24 09:34:02', '2023-11-24 09:42:16'),
(6, 'Himel', 'himel', '002.jpg', 'Himel specializes in electrical enclosures, delivering high-quality products that ensure the safety and protection of electrical components.', 2, 1, '2023-11-24 09:46:03', '2023-11-24 09:46:03'),
(7, 'Bticino', 'bticino', 'BTicino.jpg', 'Bticino, a Legrand brand, is synonymous with stylish and innovative electrical solutions, including wiring devices and home automation.', 2, 1, '2023-11-24 10:31:05', '2023-11-24 10:31:05'),
(8, 'Omron', 'omron', 'omron.jpg', 'Omron is a global leader in automation, sensing, and control technologies, providing advanced solutions for various industries.', 2, 1, '2023-11-24 10:32:16', '2023-11-24 10:32:16'),
(9, 'Allen Bradley', 'allen-bradley', 'allen-bradley.jpg', 'As part of Rockwell Automation, Allen Bradley offers a comprehensive range of automation and control solutions for industries worldwide.', 2, 2, '2023-11-24 10:33:22', '2023-11-24 10:35:38'),
(10, 'RR Kabel', 'rr-kabel', 'RR_Logo.jpg', 'RR Kabel is a trusted name in the cable industry, known for delivering high-quality and durable electrical and communication cables.', 2, 1, '2023-11-24 10:36:56', '2023-11-24 10:36:56'),
(11, 'Allen Bradley', 'allen-bradley-1', 'allen-bradley.jpg', 'As part of Rockwell Automation, Allen Bradley offers a comprehensive range of automation and control solutions for industries worldwide.', 2, 2, '2023-11-24 10:38:12', '2023-11-24 10:38:12'),
(12, 'Alfanar', 'alfanar', 'alfanar.jpg', 'Alfanar is a diversified electrical and industrial company delivering excellence in engineering, manufacturing, and construction.', 2, 1, '2023-11-24 10:40:04', '2023-11-24 10:40:04');
INSERT INTO `category` (`cat_id`, `cat_name`, `cat_canonial_name`, `cat_image`, `cat_desc`, `cat_added_user`, `cat_status`, `cat_added_date`, `cat_updated_date`) VALUES
(1, 'MCB & MCCB', 'mcb-mccb', 'Dummy_Title_Card.jpeg', 'MCBs are compact devices that protect against over currents and short circuits in low-voltage electrical systemsâ€”MCCBs are suited for higher-voltage applications.', 1, 1, '2021-07-08 21:27:58', '2023-11-03 16:22:48'),
(2, 'cat 1', '', '3.png', 'cat 1 Category description', 1, 2, '2021-07-11 14:18:08', '2021-07-11 14:18:08'),
(3, 'RCCB & RCBO', 'rccb-rcbo', 'Dummy_Title_Card.jpeg', 'RCCBs monitor and protect against ground faults, such as leakages, that can lead to electrical shock or fires. RCBOs combine ground fault protection with overcurrent protection, offering comprehensive safety.', 1, 1, '2021-07-18 05:24:37', '2023-11-03 16:23:54'),
(4, 'Timers', 'timers', 'Dummy_Title_Card.jpeg', 'From simple countdown timers to multifunctional digital timers, these devices ensure precise control over lighting, heating, cooling, and more.', 1, 1, '2021-07-18 05:25:11', '2023-11-03 16:24:21'),
(5, 'Network Accessories', 'network-accessories', 'Dummy_Title_Card.jpeg', 'Enhance network efficiency with our range of accessories for connectivity and data management.', 1, 1, '2023-11-03 16:25:01', '2023-11-03 16:25:01'),
(6, 'Float Switch', 'float-switch', 'Dummy_Title_Card.jpeg', 'Efficiently control liquid levels in tanks and pumps with our reliable and versatile float switches.', 1, 1, '2023-11-03 16:25:33', '2023-11-03 16:25:33'),
(7, 'Hour Meter', 'hour-meter', 'Dummy_Title_Card.jpeg', 'Precisely track equipment usage and maintenance schedules with our durable and accurate hour meters.', 1, 1, '2023-11-03 16:26:02', '2023-11-03 16:26:02'),
(8, 'PLC & HMI', 'plc-hmi', 'Dummy_Title_Card.jpeg', 'Empower industrial automation with our advanced Programmable Logic Controllers (PLCs) and Human Machine Interface (HMI) solutions.', 1, 1, '2023-11-03 16:26:39', '2023-11-03 16:26:39'),
(9, 'LED Lights', 'led-lights', 'Dummy_Title_Card.jpeg', 'Illuminate your space efficiently with our energy-saving LED lighting solutions, offering bright and ecofriendly illumination for various applications.', 1, 1, '2023-11-03 16:28:49', '2023-11-03 16:28:49'),
(10, 'Capacitor Switches & Sockets', 'capacitor-switches-sockets', 'Dummy_Title_Card.jpeg', 'Ensure efficient power factor correction and electrical safety with our high quality capacitor sockets.', 1, 1, '2023-11-03 16:33:33', '2023-11-03 16:33:33');
