(103, 14, 5, 'The Contactor 4KW, 400V, 9A (AC3), 20A (AC1), 3P+1NO/1NC, 220V AC Coil is a robust and reliable electrical component designed to control electric motors and other electrical loads. With a power rating of 4KW and a voltage capacity of 400V, it\'s capable of handling a variety of applications, making it suitable for residential and industrial use.\r\nThis Contactor features a 3P+1NO/1NC configuration, providing versatile control options. The 3P (3-pole) design ensures efficient power distribution, while the 1NO (1 normally open) and 1NC (1 normally closed) auxiliary contacts offer flexibility for different circuit requirements.\r\nIts 220V AC coil voltage allows for efficient and responsive switching. The Contractor is built to AC3 and AC1 standards, ensuring safe and reliable operation even in demanding conditions. Its 20A AC1 rating means it can handle heavy electrical loads during switching operations.\r\nWhether you need to control motors, lighting, heating, or other electrical equipment, this Contactor offers dependable performance, long-lasting durability, and the flexibility to adapt to your needs.'),
