(166, 23, 5, 'Time delay for star-delta (TDS) is a crucial component in electrical systems, primarily used in controlling the transition of three-phase induction motors from a star (wye) configuration to a delta configuration. This transition is essential for reducing inrush current during motor starting, minimizing mechanical stress on the system, and ensuring efficient operation.\r\nTDS devices are designed to provide a time delay between switching the motor windings from star to delta, allowing the motor to reach a stable speed before the configuration change. This delay is typically adjustable, enabling precise tuning for specific motor and load requirements.\r\nProperly configured TDS devices contribute to energy savings and reduce wear and tear on motors, making them an indispensable part of modern electrical systems.'),
