(229, 32, 5, 'The TeSysD TH O/L Relay CL10A is a reliable and efficient motor protection device to safeguard electrical motors from overload conditions. With a current range of 0.16-0.25A, this relay is crucial in industrial and commercial applications where motor-driven machinery is prevalent.\r\n\r\nEquipped with advanced technology, the TeSysD TH O/L Relay CL10A continuously monitors the current flowing through the motor. In the event of an overload, which could lead to overheating and potential damage, the relay promptly intervenes by disconnecting the engine from the power source. This not only protects the motor but also prevents downtime and costly repairs.\r\n\r\nThe adjustable current range of 0.16-0.25A provides flexibility, allowing users to customize the protection level based on the specific requirements of their motor. The relay is designed for easy installation and integration into existing control systems, ensuring a seamless and efficient motor protection solution.'),
